import React, { useEffect, useState } from "react";

import { useSelector } from "react-redux";

const Time = () => {
  const question = useSelector((state) => state.question);

  return (
    <div>
      {question ? <h2>Question: {question}</h2> : <p>No question available</p>}
    </div>
  );
};

export default Time;
